import React, { Component } from 'react'
import User from './User';
import Guest from './Guest';

export default class App extends Component {
    state = {
        isLoggedIn: false
    }

    render() {
        const isLoggedIn = this.state.isLoggedIn;
        if(isLoggedIn){
            return <User/>
        }else{
            return <Guest/>
        }
        return (
            <div>
                Hello
            </div>
        )
    }
}
